$(document).ready(function() {
    var windowwidth = window.innerWidth;
    var windowheight = window.innerHeight;

    //Window Resizing events above 768px
    if (windowwidth > 768) {
        $("#home, #who").height(windowheight);
        $("#contact").height(windowheight);
        $("#whotext").css("padding-top", ((windowheight / 2) - 111) + "px");
        $("#brandtext").css("padding-top", (windowheight / 7) + "px");
        $("#brandtext").css("padding-bottom", (windowheight / 7) + "px");
        $("#ffthinkingcontent").css("padding-top", (windowheight / 5) + "px");

        $(function() {
            $(window).scroll(function() {
                var scrollTop = $(window).scrollTop();
                if (scrollTop != 0) {
                    $('.navbar-nav').stop().animate({
                        'opacity': '0'
                    }, 200);
                } else {
                    $('.navbar-nav').stop().animate({
                        'opacity': '1'
                    }, 200);
                    $('.navbar-nav').removeClass('menubackground');
                }
                if (scrollTop >= 500) {
                    $('.navbar-nav').addClass('menubackground');
                }
            });
            $('nav').hover(
                function(e) {
                    var scrollTop = $(window).scrollTop();
                    if (scrollTop != 0) {
                        $('.navbar-nav').stop().animate({
                            'opacity': '1'
                        }, 200);
                    }
                },
                function(e) {
                    var scrollTop = $(window).scrollTop();
                    if (scrollTop != 0) {
                        $('.navbar-nav').stop().animate({
                            'opacity': '0'
                        }, 200);
                    }
                });
        });


        $('.tri-ff').hover(
            function() {
                // add some cool animation for jQuery(this)
                $(this).stop().animate({
                    'opacity': '0'
                }, 1000);
                //$('#text-f-1').stop().animate({'opacity': '1'},1000);
                $(event.target).next("span").stop().animate({
                    'opacity': '1'
                }, 1000);
            },
            function() {
                // Revert the cool animation to its initial state
                $(this).stop().animate({
                    'opacity': '1'
                }, 1000);
                //$('#text-f-1').stop().animate({'opacity': '0'},1000);
                $(event.target).next("span").stop().animate({
                    'opacity': '0'
                }, 1000);
            }
        );
    }


    $("#audiotoggleoff").hide();
    $('#audiobutton').click(function() {
        if (document.getElementById('audioplayer').paused == false) {
            $('#audioplayer').trigger("pause");
            $('#audiotoggleoff').fadeIn(1500);
        } else {
            $('#audioplayer').trigger("play");
            $('#audiotoggleoff').fadeOut(1500);
        }
    });
    //Window Resizing events below 768px
    if (windowwidth <= 768) {
        $("#home").height(windowheight);
        $("#contact").height(windowheight);
    }
    //Click to move sections
    $(function() {
        $('a.page-scroll').bind('click', function(event) {
            var $anchor = $(this);
            if (($anchor.attr('href')) === "#brands") {
                $('html, body').stop().animate({
                    scrollTop: $($anchor.attr('href')).offset().top - (windowheight / 7)
                }, 1500, 'easeInOutExpo');
                event.preventDefault();
            } else {
                $('html, body').stop().animate({
                    scrollTop: $($anchor.attr('href')).offset().top
                }, 1500, 'easeInOutExpo');
                event.preventDefault();
            }
        });
    });

    //Menu Folds back on mobile
    $('.navbar-collapse ul li a').click(function() {
        $('.navbar-toggle:visible').click();
    });

});
$(document).ready(function() {
    const videoElement = document.getElementById('video-bg');
    if (videoElement.playing) {
        // video is already playing so do nothing
    } else {
        // video is not playing
        // so play video now
        videoElement.play();
    }

    $('ul#main-menu li a').click(function() {
        $('li a').removeClass("active");
        $(this).addClass("active");
    });

    $(".ff-carousel-lg").owlCarousel({
        autoPlay: false,
        slideSpeed: 500,
        stopOnHover: true,
        navigation: false,
        pagination: true,
        paginationSpeed: 500,
        rewindSpeed: 500,
        singleItem: true,
        autoHeight: false,
        //transitionStyle : "fade"
    });

    $(".ff-carousel-xs").owlCarousel({
        autoPlay: false,
        slideSpeed: 500,
        stopOnHover: true,
        navigation: false,
        pagination: true,
        paginationSpeed: 500,
        rewindSpeed: 500,
        singleItem: true,
        autoHeight: false
    });

    /*
     * Contact Form
     */
    $('#message').keyup(function() {
        var characterCount = $(this).val().length,
            left = $('#left'),
            maximum = parseInt($(this).attr('MAXLENGTH')),
            theCount = $('#the-count'),
            remain = maximum-characterCount;

        left.text(remain);
    });

    $("form[name='contactFrom']").validate({
        // Specify validation rules
        rules: {
            // The key name on the left side is the name attribute
            // of an input field. Validation rules are defined
            // on the right side
            fullName: "required",
            telephone: "required",
            email: {
                required: true,
                // Specify that email should be validated
                // by the built-in "email" rule
                email: true
            },
            message: "required"
        },
        // Specify validation error messages
        messages: {
            firstname: "Please enter your Full Name",
            telephone: "Please enter your Telephone",
            email: "Please enter a valid email address",
            message: "Please Write some message"
        },
        // Make sure the form is submitted to the destination defined
        // in the "action" attribute of the form when valid
        // submitHandler: function(form) {
        //     var data = $( this ).serialize();
        //     console.log(data);
        // }
    });

    $('#contact-phone-number').click(function (e) {
        ga('send','event','Phone Call Tracking','Click to Call','+44 (0)207 739 4751');
        dataLayer.push({
            'event' : 'event',
            'eventCategory' : 'PhoneCallTracking',
            'eventAction' : 'Click to Call',
            'eventLabel' : 'Number',
            'eventValue' : '+44 (0)207 739 4751'
        });
    });

    $('#ff-contact').submit(function(e) {
        // we stoped it
        e.preventDefault();
        $('#g-recaptcha').remove();
        $('#mail-alert-box').empty();
        var mail = $('#email').val();
        if($(this).valid()) {
			$('.btn-send-message').text('Sending...');
            grecaptcha.ready(function() {
                // do request for recaptcha token
                // response is promise with passed token
                grecaptcha.execute('6Ldt5M8UAAAAAMZsT6Su8OGfIk2xm9zvibMRDRVL', {action: 'fearlesslyfrank_contact'}).then(function(token) {
                    // add token to form
                    $('#ff-contact').prepend('<input type="hidden" id="g-recaptcha" name="g-recaptcha-response" value="' + token + '">');
                    // g recaptcha
                    var data = $( '#ff-contact' ).serialize();
                    $.post('sendMail.php', data)
                        .done(function(result){
                            if(result){
                                var data =  JSON.parse(result)
                                if(data.success.status==true) {
                                    $('#ff-contact').find("input[type=text],input[type=email],input[type=tel], textarea").val("");
                                    $('#left').text($('#message').attr('MAXLENGTH'));
                                    /*
                                     ga('send', 'event', [eventCategory], [eventAction], [eventLabel], [eventValue], [fieldsObject]);
                                    ga('send', {
                                              hitType: 'event',
                                              eventCategory: 'Videos',
                                              eventAction: 'play',
                                              eventLabel: 'Fall Campaign'
                                            });
                                     */
                                    ga('send','event','Contact Form','Message Received','Submitted from '+mail);
                                    dataLayer.push({
                                        'event' : 'contactForm',
                                        'eventCategory' : 'messageReceived',
                                        'eventAction' : 'Message Received',
                                        'eventLabel' : 'Number',
                                        'eventValue' : 'Submitted from '+mail
                                    });
                                    $('#mail-alert-box').addClass('alert-success');
                                    $('#mail-alert-box').append(data.success.msg);
                                } else {
                                    if(data.error.captcha==true){
                                        $('#mail-alert-box').addClass('alert-danger');
                                        $('#mail-alert-box').append('<strong>You are spammer ! Get the @$%K out.</strong>')
                                    }
                                }
                            }else {
                                $('#mail-alert-box').addClass('alert-danger');
                                alert('You are spammer ! Get the @$%K out.');
                            }
                            $('.btn-send-message').text('Send Message');
                        })
                        .fail(function(xhr, status, error) {
                            // error handling
                            $('.btn-send-message').text('Send Message');
                            console.log(error);
                        });
                });
            });
        }


        // needs for recaptacha ready

    });

    // Activate contact menu when click
    $('.menu-contact a').click(function (e) {
       $(this).addClass("active");
       $("#main-menu li a").removeClass("active");
    });

    //
    // Activate Menu according to section
    $(document).on("scroll", onScroll);

    function onScroll(event){
        var scrollerElems = {};
        var percentPipe;
        var selector;

        // Targeted all the link
        $('ul#main-menu li a, .menu-contact a').each(function () {
            var currLink = $(this);
            var refElement = $(currLink.attr("href"));
            percentPipe = getThePerCentageOfScrolledElement(refElement);
            if(percentPipe){
                // Build the Object According to percentage
                selector = refElement.selector;
                scrollerElems[selector]=percentPipe;
            }
        });

        var highestKey = getTheHighestValueFromObject(scrollerElems);

        // Put the class according heighestt value
        $('ul#main-menu li a, .menu-contact a').removeClass("active");

        $(' a[href$="'+highestKey+'"]').addClass("active");

    }

    function getTheHighestValueFromObject(scrollerElems) {
        //console.log(scrollerElems);
        var max = 0;
        var newKey;

        // get the highest Percentage of given Elements
        Object.keys(scrollerElems).forEach(function(key){
            newKey = (scrollerElems[key] > max ) ? key : newKey;
            max = (scrollerElems[key] > max ) ? scrollerElems[key] : max;
        });

        return newKey;
    }

    // Get the Percentage of Scrolled Element
    function getThePerCentageOfScrolledElement(element)
    {
       // console.log(elem.selector);
        var elementTop = element.offset().top;
        var scrollTop = $(window).scrollTop();
        var spaceTop = elementTop - scrollTop;
        var elementHeight = element.height();
        var screenHeight = $(window).height();
        var scrollBottom = scrollTop + screenHeight;
        var bottomElement = elementTop + element.height();
        var spaceBottom = bottomElement - scrollBottom;
        var heightInScreen = elementHeight - spaceBottom;
        var percentage;

        if (spaceTop < 0) {
            heightInScreen -= spaceTop * -1;
        }

        if (spaceBottom < 0) {
            heightInScreen -= spaceBottom * -1;
        }

        percentage = heightInScreen / screenHeight * 100;
        percentage = percentage < 0 ? 0 : percentage;
        return parseInt(percentage);
    }

});
